import React from "react";
import styles from "./styles.module.css";
import jsonData from "./components/productData.json";

function App() {
  return (
    <div>
      <input type="text" />
      {jsonData.map((value, key) => {
        return (
          <div>
            <div>
            <h2>{value.ProductName}</h2>
            <h3>{value.Price}</h3>
            </div>

          </div>
        );
      })}
    </div>
  );
}

export default App;
